import { Image } from "@chakra-ui/image";
import { Flex } from "@chakra-ui/layout";
import React from "react";
interface CardProps {
  name?: string;
  category?: string;
  image?: string;
  price?: string;
  userId?: number;
  id?: number;
}
export const Card = ({
  name,
  category,
  image,
  price,
  userId,
  id,
}: CardProps) => {
  return (
    <Flex justifyContent="center" flexDirection="column" alignItems="center">
      <p>{name}</p>
      <p>{category}</p>
      <Image alt={name} src={image} />
      <p>{price}</p>
    </Flex>
  );
};
